import React from 'react'

function Posts2({posts}) {
    return (
        <div>
            {posts.map((post)=>{
                return(
                    <ul>
                    <li>{post.brand_name}</li>
                    <li>{post.address.state}</li>
                    <li>{post.price}</li>
                    </ul>
                )
            })}
        </div>
    )
}

export default Posts2
